import React from 'react';
import './App.css';
import Home from './pages/Home'
import Search from './pages/Search';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="app">
      <h1>Google </h1>
      <Home />
      <Search />
    </div>
  );
}

export default App;
